import { Link, useNavigate } from "react-router-dom";
import "./NavBar.css";

export const NavBar = () => {
  const navigate = useNavigate();

  return (
    <ul className="navbar bg-blue-500 p-4 shadow-lg">
      {(localStorage.getItem("tt_token") !== null) ? (
        <li className="nav-item">
          <button
            className="nav-link text-white hover:text-gray-200"
            onClick={() => {
              localStorage.removeItem("tt_token");
              navigate("/login");
            }}
          >
            Logout
          </button>
        </li>
      ) : (
        <>
          <li className="nav-item">
            <Link
              className="nav-link text-white hover:text-gray-200"
              to="/login"
            >
              Login
            </Link>
          </li>
          <li className="nav-item">
            <Link
              className="nav-link text-white hover:text-gray-200"
              to="/register"
            >
              Register
            </Link>
          </li>
        </>
      )}
    </ul>
  );
};
